import React from 'react';
import Menu from './Menu.js';
import ImageCollage from './ImageCollage.js';

const displays = [<Menu/>, <ImageCollage/>];

export default class App extends React.Component{
    constructor(){
        this.state = {display:0};
    }

    handleDisplayChange = d => {this.setState({display:d});};

    render(){
        return(
            <div>
                {displays[this.display].setAttribute('handleDisplayChange', '{handleDisplayChange}')}
            </div>
        )
    }
}
